import React, { Component } from "react";
import dynamic from 'next/dynamic'
const PdfPreview = dynamic(() => import('react-pdf-preview'), {ssr:false})

class Resume extends Component {
    render () {
        return (
            <PdfPreview src="https://assets.publishing.service.gov.uk/government/uploads/system/uploads/attachment_data/file/878326/main-euss-guidance-v4.0ext.pdf" />
        )
    }
}

export default Resume
